import React from 'react';
import EntryForm from './components/EntryForm';
import ExitForm from './components/ExitForm';
import Analytics from './components/Analytics';
import './App.css';

const App: React.FC = () => {
  return (
    <div>
      <h1>Building Entry System</h1>
      <EntryForm />
      <ExitForm />
      <Analytics />
    </div>
  );
};

export default App;
